Santa Cruz County 4-H, Arizona
May 7 at 1:06 AM ¬∑

Congratulations to Allan Corona on his graduation from Rio Rico High School. Allan is also completing the Pima JTED EMT program in October. Allan served as Vice President of the Rattlesnakes Club, he loves taking care of his animals and spending time with his family. Thank you for your dedication and commitment to 4-H in Santa Cruz County! Best of luck in College and in all your future endeavors Allan ! üçÄ Jennifer Paz; @ Richard McPherson; Dean Fish; Mustang 4-H Club; Rattlesnakes 4-H Club;

